import styled from "styled-components";

export const StyledNavigationBar = styled.div`
  display: flex;
  position: fixed;
  width: 100vw;
  flex-direction: row;
  background: #262626;
  font-size: 18px;
  z-index: 1000;
  height: 4em;
  align-items: center;
`;

export const StyledLogo = styled.a`
  margin-left: 2em;
  text-decoration: none;
  color: #fff;
  font-weight: 600;
  letter-spacing: 3px;
`;

export const YellowAccent = styled.span`
  color: #fdd835;
`;
